        return 0
    n = len(string)
    m = len(substring)
    lps = [0] * m
    length = 0
    i = 1
    while i < m:
        if substring[i] == substring[length]:
            length += 1
            lps[i] = length
            i += 1
        else:
            if length != 0:
                length = lps[length-1]
            else:
                lps[i] = 0
                i += 1
    count = 0
    i = 0
    j = 0
    while i < n:
        if substring[j] == string[i]:
            i += 1
            j += 1
        if j == m:
            count += 1
            j = lps[j-1]
        elif i < n and substring[j] != string[i]:
            if j != 0:
                j = lps[j-1]
            else:
                i += 1
    return count

