def find_zero(xs: list):
    constant = xs[0]
    leading = xs[-1]

    def get_divisors(n):
        if n == 0:
            return set()
        divs = set()
        for i in range(1, abs(n) + 1):
            if n % i == 0:
                divs.add(i)
                divs.add(-i)
        return divs

    divs_const = get_divisors(constant)
    divs_lead = get_divisors(leading)

    candidates = []
    for p in divs_const:
        for q in divs_lead:
            if q == 0:
                continue
            candidates.append(p / q)

    for x in candidates:
        total = 0.0
        for i in range(len(xs) - 1, -1, -1):
            total = total * x + xs[i]
        if abs(total) < 1e-5:
            return x

    best = None
    min_error = float('inf')
    for x in candidates:
        total = 0.0
        for i in range(len(xs) - 1, -1, -1):
            total = total * x + xs[i]
        error = abs(total)
        if error < min_error:
            min_error = error
            best = x
    return best

