from collections import deque

def generate_integers(a, b):
    low = min(a, b)
    high = max(a, b)
    queue = deque(['2', '4', '6', '8'])
    results = []
    while queue:
        num_str = queue.popleft()
        num = int(num_str)
        if num > high:
            continue
        if num >= low:
            results.append(num)
        for digit in '02468':
            next_num = num_str + digit
            next_num_int = int(next_num)
            if next_num_int <= high:
                queue.append(next_num)
    return results
